  03> HUTTON, George Thomas Frederick m on 28.06.1881 to (1) BARTON, Catherine Carne
  b 10.08.1854 d 26.01.1937
  b 25.06.1852 d 20.12.1909
  George b. at Pakaraka, Bay of Islands, d, at Masterton and bd, at Martinborough. He was educated at Bishop's
  Court, Parnell (later to become the Auckland Grammar School). Catherine nee Bidwill d. and bd, at Featherston.
  After the death of his mother in 1866, George's father returned to England taking his second daughter, Anna,
  with him, George and his sister, Marianne, went to Te Aute where they lived with their uncle, Archdeacon
  Samuel Williams. George moved to the Wairarapa about 1875 and lived at Featherston for a time. He later took
  up land at Martinborough where he spent the rest of his life. He was an accomplished Maori linguist and was a
  licensed interpreter often engaged by the Government in land transactions.
  01> HUTTON, Edward George m on 02.07.1919 to ARNDT, Alice May
  b 28.01.1882 d 15.10.1930
  b 30.04.1889 d 27.03.1945
  Edward b. at Featherston, m. at St Matthew's Church, Auckland, d, and bd, at Pahiatua. Alice, d/o William
  Theodore Arndt and Maria Brown, b. at Parnell, d. at Auckland and bd, at Pahiatua.
  Edward was educated at Napier Girl's College until he was about 12 and then at Wanganui College until about
  1901. He was engaged in farming at Martinborough and later at Pahiatua until he lost the farm during the
  Depression. He died shortly afterwards, Alice was a dressmaker and had a shop in Parnell until she married.
